import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Shared/Navbar';
import HomePage from './components/Home/HomePage';
import DevLogin from './components/Auth/DevLogin';
import OrgLogin from './components/Auth/OrgLogin'; 
import DevSignUp from './components/Auth/DevSignUp'; 
import OrgSignUp from './components/Auth/OrgSignUp'; 

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login-developer" element={<DevLogin />} />
          <Route path="/login-organization" element={<OrgLogin />} />
          <Route path="/signup-developer" element={<DevSignUp />} />
          <Route path="/signup-organization" element={<OrgSignUp />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
